import suap from "../servico/suap/client"
import "../servico/suap/js.cookie"
import settings from "../servico/suap/settings"
import "../servico/suap/settings.sample"
import "https://cdnjs.cloudflare.com/ajax/libs/jquery/3.4.1/jquery.min.js"
function SuapLogin() {
  var suap = new SuapClient(
    settings.SUAP_URL, settings.CLIENT_ID, settings.HOME_URI, settings.REDIRECT_URI, settings.SCOPE
  );
  suap.init();
  $(document).ready(function () {
    $("#suap-login-button").attr('href', suap.getLoginURL());
  });
  return (
    <>
      <a id="suap-login-button"><button>Entrar com o SUAP</button></a>
    </>
  )

}

export default SuapLogin;
